import React from "react";
import inventory from "../../Data/inventory.json";
import Footer from "../Footer";

export default function ProductList() {
  const stockImg = inventory.map(({ images }) => images);
  {
    const imgs = stockImg.entries(({ front }) => front);
    console.log(imgs);
    return <img src={imgs.front} alt="pictures" />;
  }
}
